import './App.css';
import AddProduct from './frontend/add_product';
import { Router, Route, Routes  } from 'react-router-dom';
import ProductList from './frontend/product_list';

function App() {
  return (
    <div>

      <Routes>
      <Route exact path="/add_product" element={<AddProduct/>} />

      <Route exact path="/product_list" element={<ProductList/>} /> 
      </Routes>



    </div>
  );
}

export default App;
